INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 102301, 401, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "アヤネ", 24, 24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 102301, 402, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2.21, "アヤネ", 24, 24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 102301, 403, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "アヤネ", 24, 24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192201, 701, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 1.99, "アサヒ", 24, 24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192201, 702, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2.21, "アサヒ", 24, 24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192201, 703, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 3.33, "アサヒ", 24, 24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192301, 801, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "部員３", 24, 24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192301, 802, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 2.68, "部員３", 24, 24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192301, 803, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "部員３", 24, 24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192501, 501, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 0.0, "", 24, 24010, "やった！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192501, 502, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 0.0, "", 24, 24011, "勝ったよ！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192501, 503, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 0.0, "", 24, 24012, "いい調子！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113501, 111, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 5.33, "ミサト", 24, 24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113501, 112, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 6.85, "ミサト", 24, 24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113501, 113, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 3.0, "ミサト", 24, 24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192401, 611, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 6.11, "ダイチ", 24, 24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192401, 612, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 6.75, "ダイチ", 24, 24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192401, 613, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "ダイチ", 24, 24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113401, 211, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 4.52, "ハツネ", 24, 24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113401, 212, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 3.89, "ハツネ", 24, 24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113401, 213, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 13.49, "ハツネ", 24, 24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 106501, 311, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 3.17, "カヤ", 24, 24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 106501, 312, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 4.42, "カヤ", 24, 24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 106501, 313, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 2.89, "カヤ", 24, 24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 102301, 421, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3, 3.71, "アヤネ", 24, 24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192201, 721, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 5.1, "アサヒ", 24, 24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192301, 821, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3, 4.34, "部員３", 24, 24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 192501, 521, 0.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 0.0, "", 24, 24028, "いい勝負だったよ\nまたやろうね", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113501, 101, -360.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 5.62, "ミサト", 24, 24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113501, 102, -360.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 9.58, "ミサト", 24, 24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113501, 103, -360.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 0.0, "ミサト", 24, 24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113501, 104, -360.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1, 9.13, "ミサト", 24, 24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, 113501, 105, -360.0, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2, 8.27, "ミサト", 24, 24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 0.0);
